import background from "../assets/backgroundplain.png"
//import Flexbox from 'flexbox-react';
import '../pages/pages.css'

const Results = () => {
  const style = {
    //Now working
    backgroundImage: `url(${background})`,
    height: "100vh",
    backgroundSize: "cover",
}
  return (
    <div style={style}>
      <h2>Model Results</h2>
    </div>

  )
}

export default Results
